const initialState = {
  name: "woody",
  age: 30,
  password: "code",
};

const rootReducer = (state = initialState, action) => {
  switch (action.type) {
    case "CHANGE_NAME":
      return {
        ...state,
      };

      break;

    default:
      break;
  }
};

export default rootReducer;
